import os
import numpy as np
from trackit.datasets.SOT.constructor import SingleObjectTrackingDatasetConstructor
from trackit.miscellanies.natural_keys import natural_keys


def construct_LaSOT(constructor: SingleObjectTrackingDatasetConstructor, seed):
    root_path = seed.root_path
    data_split = seed.data_split

    subset_sequence_names = []

    if 'train' in data_split:
        subset_sequence_names.extend(_training_set)

    if 'test' in data_split:
        subset_sequence_names.extend(_testing_set)

    category_id_name_map = {i: class_name for i, class_name in enumerate(_categories)}

    constructor.set_category_id_name_map(category_id_name_map)
    category_name_id_map = {v: k for k, v in category_id_name_map.items()}

    constructor.set_attribute('attribute name', LaSOTAttributes.ATTRIBUTE_NAMES)
    constructor.set_attribute('attribute short name', LaSOTAttributes.ATTRIBUTE_SHORT_NAMES)

    tasks = []

    for category_name in _categories:
        if not any(sequenceName.startswith(category_name) for sequenceName in subset_sequence_names):
            raise Exception()

        class_path = os.path.join(root_path, category_name)
        sequence_names = os.listdir(class_path)
        sequence_names = [sequence_name for sequence_name in sequence_names if
                          os.path.isdir(os.path.join(class_path, sequence_name))]
        sequence_names.sort(key=natural_keys)

        for sequence_name in sequence_names:
            if sequence_name not in subset_sequence_names:
                continue
            tasks.append((category_name, sequence_name))

    constructor.set_total_number_of_sequences(len(tasks))

    for category_name, sequence_name in tasks:
        category_id = category_name_id_map[category_name]
        class_path = os.path.join(root_path, category_name)

        with constructor.new_sequence(category_id) as sequence_constructor:
            sequence_constructor.set_name(sequence_name)
            sequence_constructor.set_attribute('attributes', LaSOTAttributes.SEQUENCE_ATTRIBUTES[sequence_name])
            sequence_constructor.set_fps(30)
            sequence_path = os.path.join(class_path, sequence_name)
            groundtruth_file_path = os.path.join(sequence_path, 'groundtruth.txt')
            bounding_boxes = np.loadtxt(groundtruth_file_path, dtype=np.int64, delimiter=',')
            bounding_boxes[:, 0:2] -= 1
            full_occlusion_file_path = os.path.join(sequence_path, 'full_occlusion.txt')
            is_fully_occluded_flags = np.loadtxt(full_occlusion_file_path, dtype=np.bool_, delimiter=',')
            out_of_view_file_path = os.path.join(sequence_path, 'out_of_view.txt')
            is_out_of_view_flags = np.loadtxt(out_of_view_file_path, dtype=np.bool_, delimiter=',')
            nature_language_description_file_path = os.path.join(sequence_path, 'nlp.txt')
            frame_size = _sequence_frame_size[sequence_name]
            with open(nature_language_description_file_path, 'r', encoding='utf-8', newline='') as f:
                nature_language_description = f.read()
            sequence_constructor.set_object_attribute('nature language description', nature_language_description)

            image_folder_path = os.path.join(sequence_path, 'img')
            if len(bounding_boxes) != len(is_fully_occluded_flags) or len(is_fully_occluded_flags) != len(is_out_of_view_flags):
                raise Exception('annotation length mismatch in {}'.format(sequence_path))
            # helps to fix the monkey-17 issue. see https://github.com/HengLan/LaSOT_Evaluation_Toolkit/blob/95bf38ae4f75965739546ae1fd7d5556dfc6e5c6/utils/calc_seq_err_robust.m#L6
            image_file_names = tuple(f'{i+1:08d}.jpg' for i in range(len(bounding_boxes)))
            for image_file_name, bounding_box, is_fully_occluded, is_out_of_view in zip(image_file_names, bounding_boxes, is_fully_occluded_flags, is_out_of_view_flags):
                image_file_path = os.path.join(image_folder_path, image_file_name)
                with sequence_constructor.new_frame() as frame_constructor:
                    frame_constructor.set_path(image_file_path, frame_size)
                    frame_constructor.set_bounding_box(bounding_box.tolist(), validity=not (is_fully_occluded or is_out_of_view))
                    frame_constructor.set_object_attribute('occlusion', is_fully_occluded.item())
                    frame_constructor.set_object_attribute('out of view', is_out_of_view.item())


